import { CommonModule } from '@angular/common';
import { NgModule } from '@angular/core';
import { ListagemRoutingModule } from '@modules/features/listagem/listagem.routing.module';

@NgModule({
    imports: [CommonModule, ListagemRoutingModule]
})
export class ListagemModule {}
